description.text:
I've gotten the measurements from online, and haven't tested it myself, so no guarantees that this brick will fit. If you decide to print, please let me know! (I imagine you'll have to slice it in half before the pegs and print the bottom and top halves to avoid printing massive amounts of support).  
Open the scad file in OpenSCAD and start tweaking the variables at the top:  
//Non-Zero integer values for rows and cols, or number of pegs<br />
numRows = 2;<br />
numCols = 3;  
// 1/3 and 1 are the two standard heights,<br />
// all non-negative heights technically supported<br />
height = 1;  
// Multiples of 2 of each other can fit into each other<br />
brickScale = 1.0;   
// The higher the number, the smoother the curves<br />
// (pump this number up if planning on printing)<br />
curveFidelity = 50;
